// PropertyTypeSection.jsx
import React from 'react';
import { FaHome, FaBuilding, FaTree, FaCity, FaStore, FaRegBuilding } from 'react-icons/fa'; // Sample icons


 export const PropertyType= () => {
  const propertyTypes = [
    { icon: <FaHome />, name: 'Flats' },
    { icon: <FaBuilding />, name: 'Terraces' },
    { icon: <FaTree />, name: 'Villas' },
    { icon: <FaCity />, name: 'Maisonettes' },
    { icon: <FaStore />, name: 'Shops' },
    { icon: <FaRegBuilding />, name: 'Offices' },
  ];

  return (
    <div className="property-type">
      {propertyType.map((type, index) => (
        <div className="property-type-card" key={index}>
          <div className="icon">{type.icon}</div>
          <p>{type.name}</p>
        </div>
      ))}
    </div>
  );
};

export default PropertyType;
